<body>
  <div id="chart" style="width: 100%;height: 1000px"></div>
  <script type="text/javascript">
    let echart = echarts.init(document.getElementById('chart'));
    // 设置节点类型
    const categories = [
            {
              "name": "产品"
            },
            {
              "name": "农夫"
            },
            {
              "name": "乐百氏"
            },
            {
              "name": "哇哈哈"
            },
            {
              "name": "北京渠道"
            },
            {
              "name": "天津渠道"
            },
            {
              "name": "河北渠道"
            },
          
          ]
    const options = {
      "title": [
        {
          "left": "left",
          "text": "产品渠道关系图"
        }
      ],
      color:['#c23531','#2f4554', '#61a0a8', '#d48265', '#91c7ae','#749f83',  '#ca8622', '#bda29a','#6e7074', '#546570', '#c4ccd3'],
      legend: [{
            // selectedMode: 'single',
            right:0,
            data: categories.map(function (a) {
                return a.name;
            })
        }],
      tooltip: {
        "formatter": function (arg) {
          let nodeType = arg.data.nodeType,
            srcName = arg.name,
            seriesIndex = arg.seriesIndex,
            options = echart.getOption(),
            serieData = options.series[seriesIndex].data,
            serieLinks = options.series[seriesIndex].links,
            colors = options.color,
            serieDataMap = new Map(),
            serieLinkArr = [],
            tips = '';
          // 父节点，排除根节点
          if (nodeType === 10) {
            serieLinks.filter(link => link.source === srcName).forEach(link => serieLinkArr.push(link.target));
            if (serieLinkArr.length) {
              serieData.forEach(sd => serieDataMap.set(sd.name, sd));
              for (let i = 0; i < serieLinkArr.length; i++) {
                if (serieDataMap.has(serieLinkArr[i])) {
                  let currentData = serieDataMap.get(serieLinkArr[i]),
                    color = getColor(colors, currentData.category);
                  tips += '<span style="background-color: ' + color + ';width: 10px;height: 10px;border-radius: 50%;display: inline-block"></span> ' + currentData.legendName + " : " + currentData.name + ' <br />';
                }
              }
            }
            return tips;
          } else {
            return '';
          }
        }
      },
      "series": [
        {
          "name": "关系图",
          "type": "graph",
          "showSymbol": true,
          "yAxisIndex": 0,
          "z": 2,
          "layout": "force",
          "roam": true,
          "edgeSymbolSize": [
            8,
            10
          ],
          "edgeSymbol": [
            "circle",
            // "arrow"
          ],
          "focusNodeAdjacency": true,
          "force": {
            "repulsion": 300,
            "edgeLength": 50,
            "layoutAnimation":true
          },
          "itemStyle": {
            "normal": {
              "label": {
                "show": false
              },
              "borderType": "solid",
              "borderColor": "rgba(182,215,0,0.5)",
              "borderWidth": 1,
              "opacity": 1
            },
            "emphasis": {
              "borderWidth": 3,
              "borderType": "solid",
              "borderColor": "#fd1800"
            }
          },
          "lineStyle": {
            "normal": {
              // "color": "rgba(182,0,255,0.5)",
              // "width": "3",
              // "type": "dotted",
              // "curveness": 0.1,
              // "opacity": 1
            }
          },
          "label": {
            "normal": {
              "show": false,
              "position": "top",
              "formatter": function (args) {
                if (args.data.nodeType === 1) {
                  return args.data.legendName;
                } else {
                  return args.data.legendName + ":" + args.name;
                }
              },
              // "rich": {
              //   "prefixClassName": {
              //     color: "#fff",
              //     fontWeight: "bold"
              //   }
              // }
            }
          },
          "categories": categories,
          "links":edata.links,
          "data":edata.nodes
        }
      ]
    };
    echart.setOption(options);
  // 单纬初始化
  let _options = echart.getOption(),
      serieLinks = _options.series[0].links,
      serieData = _options.series[0].data,
      serieDataMap = new Map();
    serieData.forEach(sd => serieDataMap.set(sd.name, sd));
    bindChartClickEvent(echart);

    /**
     * 获取颜色
     * @param colors
     * @param index
     * @returns {*}
     */
    function getColor(colors, index) {
      let length = colors.length,
        colorIndex = index;
      if (index >= length) {
        colorIndex = length - index;
      }
      return colors[colorIndex];
    }

    /**
     * 绑定图表的点击事件
     * @param chart
     */
    function bindChartClickEvent(chart) {
       chart.on('click', function (params) {
        let category = params.data.category,
          nodeType = params.data.nodeType;
        if (category === 0 || nodeType === 1) {
          toggleShowNodes(chart, params);
        }
      });
    }

    /**
     * 展开或关闭节点
     * @param chart
     * @param params
     */

    function toggleShowNodes(chart, params) {
      let open = !!params.data.open,
        srcLinkName = params.name,
        serieLinkArr = [];

      const t0 = performance.now()  
      // 当前根节点是展开的，那么就需要关闭所有的根节点
              // 递归找到所有的link节点的target的值
              findLinks(serieLinkArr, srcLinkName, serieLinks, open);
      if (serieLinkArr.length) {
          for (let i = 0; i < serieLinkArr.length; i++) {
            if (serieDataMap.has(serieLinkArr[i])) {
              let currentData = serieDataMap.get(serieLinkArr[i]);
              if(open) {
                currentData.category = -Math.abs(currentData.category);
                if (currentData.nodeType === 1) {
                currentData.open = false;
              }
              }
              else {
                currentData.category = Math.abs(currentData.category);
              }
              

            }
          }

      const t1 = performance.now()  
      serieDataMap.get(srcLinkName).open = !open;
      console.log('查询节点和关系耗时:', (t1 - t0)/1000);
      const e0 = performance.now()  
      chart.setOption(_options);
      const e1 = performance.now() 
      console.log('canvas渲染耗时:', (e1 - e0)/1000); 
    }
    }

    /**
     * 查找连接关系
     * @param links 返回的节点放入此集合
     * @param srcLinkName 源线的名称
     * @param serieLinks 需要查找的集合
     * @param deep 是否需要递归进行查找
     */
    function findLinks(links, srcLinkName, serieLinks, deep) {
      let targetLinks = [];
      serieLinks.filter(link => link.source === srcLinkName).forEach(link => {
       deep && targetLinks.push(link.target);
        links.push(link.target)
      });
      if (deep) {
        for (let i = 0; i < targetLinks.length; i++) {
          findLinks(links, targetLinks[i], serieLinks, deep);
        }
      }
    }
  </script>
</body>
